import React from 'react';
import { Routes,Route } from 'react-router-dom';

import './App.css';
import {AddUser} from './components/AddUser'

function App() {
  return (
    <div className="App">
       <Routes>
        <Route path="/" element={<AddUser />} />
      </Routes>
    </div>
  );
}

export default App;
